
/*
 * node - элемент у которого нужно найти соседей
 * list - список всех элементов
 */

var getSiblings = function(node, list) {
	
	var siblingList = [];
	
	for (var n = list.length - 1; n >= 0; n--) {
		
		if (list[n] != node) {
			
			siblingList.push(list[n]);
			
		} 
		
	}
	
	return siblingList;
	
}